module.exports = /*#__PURE__*/JSON.parse('{"title":"EPNS at NFT NYC 2022: All set for the NFTVerse","description":"Cover Image of EPNS at NFT NYC 2022: All set for the NFTVerse","frontMatter":{"slug":"epns-at-nft-nyc-2022-all-set-for-the-nft-verse","title":"EPNS at NFT NYC 2022: All set for the NFTVerse","authors":["push"],"image":"./cover-image.webp","text":"We‚Äôre all set and headed to the biggest NFT Party in the world! Touted as the Superbowl of the NFTs and the new CES for NFTs by our frens at Coinbase and Ledger respectively, hsow can we miss this event!","tags":["Nft","Ethereum","Blockchain","Cryptocurrency","Crypto"]},"content":{"id":"epns-at-nft-nyc-2022-all-set-for-the-nft-verse","metadata":{"permalink":"/push-website/pr-preview/pr-858/blog/epns-at-nft-nyc-2022-all-set-for-the-nft-verse","source":"@site/blog/2022-06-21-epns-at-nft-nyc-2022/index.md","title":"EPNS at NFT NYC 2022: All set for the NFTVerse","description":"Cover Image of EPNS at NFT NYC 2022: All set for the NFTVerse","date":"2022-06-21T00:00:00.000Z","formattedDate":"June 21, 2022","tags":[{"label":"Nft","permalink":"/push-website/pr-preview/pr-858/blog/tags/nft"},{"label":"Ethereum","permalink":"/push-website/pr-preview/pr-858/blog/tags/ethereum"},{"label":"Blockchain","permalink":"/push-website/pr-preview/pr-858/blog/tags/blockchain"},{"label":"Cryptocurrency","permalink":"/push-website/pr-preview/pr-858/blog/tags/cryptocurrency"},{"label":"Crypto","permalink":"/push-website/pr-preview/pr-858/blog/tags/crypto"}],"readingTime":3.25,"hasTruncateMarker":true,"authors":[{"name":"Push Protocol","url":"https://twitter.com/pushprotocol","imageURL":"/assets/blog/authors/authorpush.png","key":"push"}],"frontMatter":{"slug":"epns-at-nft-nyc-2022-all-set-for-the-nft-verse","title":"EPNS at NFT NYC 2022: All set for the NFTVerse","authors":["push"],"image":"./cover-image.webp","text":"We‚Äôre all set and headed to the biggest NFT Party in the world! Touted as the Superbowl of the NFTs and the new CES for NFTs by our frens at Coinbase and Ledger respectively, hsow can we miss this event!","tags":["Nft","Ethereum","Blockchain","Cryptocurrency","Crypto"]},"unlisted":false,"prevItem":{"title":"ETHNewYork: BUIDL the future of Web3 comm with EPNS üóΩüöÄüîî","permalink":"/push-website/pr-preview/pr-858/blog/eth-new-york-buidl-the-future-of-web3-comm-with-epns"},"nextItem":{"title":"EPNS + Graph Hackathon 2022 Winners Announced!","permalink":"/push-website/pr-preview/pr-858/blog/epns-graph-hackathon-2022-winners-announced"}},"content":"import { ImageText, VideoContainer } from \'@site/src/css/SharedStyling\';\\n\\n![Cover Image of EPNS at NFT NYC 2022: All set for the NFTVerse](./cover-image.webp)\\n\\n<!--truncate-->\\n\\nWe‚Äôre all set and headed to the biggest NFT Party in the world! Touted as the Superbowl of the NFTs and the new CES for NFTs by our frens at Coinbase and Ledger respectively, hsow can we miss this event!\\n\\nSo excited to be part of this <b>4th Annual NFT Industry Event</b> in person and the EPNS Team is going to be doing some really exciting things while we‚Äôre at NFT NYC!\\n\\nHere‚Äôs a little bit about what we‚Äôre up to at <b></b>\\n\\n<b>Catch up the EPNS Team over a coffee</b>\\n\\n![Push Team 1 Image](./image-1.webp)\\n<ImageText>From L-R ‚Äî Fabio, Richa & Jaf (EPNS Team at NFT NYC)</ImageText>\\n\\nAs excited as we are about a ton of things we‚Äôre doing at NFT NYC, we‚Äôre truly excited to meet new frens, and the community at this amazing event!\\n\\nYou can drop by and say hello at the <b>Barista Coffee Cart on June 22 - Marriott 7th floor!</b>\\n\\nIf you‚Äôre a channel, marketplace, developer or an NFT artist, there‚Äôs a ton of opportunities for us to sync up on! So we‚Äôd really love to meet up irl!\\n\\nFeel free to reach out to our team members [Richa](http://twitter.com/riijo/), [Jaf](https://twitter.com/jafetsc) or [Fabio](https://twitter.com/learn4life6) on Twitter!\\n\\nOh and of course you‚Äôd also get to grab some of our cool EPNS Merch while you‚Äôre there!\\n\\n![Push Swags-1 Image](./image-2.webp)\\n<ImageText>Come say hello when you‚Äôre at NFT NYC</ImageText>\\n\\n![Push swags-2 Image](./image-3.jpeg)\\n<ImageText>A closer look at our EPNS Swag Tees!</ImageText>\\n\\n<b>Launch of Rockstars of EPNS V2</b>\\n\\n![Rockstars of EPNS V2 Image](./image-4.png)\\nAlmost about a year ago, EPNS did a really awesome activity for our amazing community!\\n\\nWe kicked off [The Rockstars of EPNS](https://medium.com/ethereum-push-notification-service/the-first-nft-collection-from-epns-677e23173c95), our first collection of [NFTS](https://opensea.io/collection/rockstars-of-epns) which we dropped to celebrate the launch of $PUSH!\\n\\n<iframe src=\\"https://cdn.embedly.com/widgets/media.html?type=text%2Fhtml&amp;key=a19fcc184b9711e1b4764040d3dc5c07&amp;schema=twitter&amp;url=https%3A//twitter.com/epnsproject/status/1519367021695172615&amp;image=https%3A//i.embed.ly/1/image%3Furl%3Dhttps%253A%252F%252Fabs.twimg.com%252Ferrors%252Flogo46x38.png%26key%3Da19fcc184b9711e1b4764040d3dc5c07\\" allowfullscreen=\\"\\" frameborder=\\"0\\" height=\\"689\\" width=\\"680\\" title=\\"EPNS | $PUSH on Twitter: &quot;1/ And just like that, this amazing ride of 52 weeks of #RockstarsOfEpns has come to an endü•∫We\'ve never felt so loved!üíïThank you everyone for all the love &amp; support over these past 52 weeks &amp; more!‚ú®But what next?üëÄ Dive in to learn what\'s coming!üëáhttps://t.co/azt3vlmUhN pic.twitter.com/9nc6ebO376 / Twitter&quot;\\" class=\\"ek n fc dx bg\\" scrolling=\\"no\\"></iframe>\\n\\nAt EPNS we are huge fans of the NFT space and the emerging creator economy and we were so thrilled to be witnessing a wave of adoption among creators and artists.\\n\\nSo, we decided to throw our hat in the ring by supporting artists, celebrating our origins, and giving back to the community along the way. And that was just in time for the $PUSH token sale and the EPNS mainnet launch! üôå\\n\\nAnd guess what? Just in time for NFT NYC, we‚Äôre super excited and thrilled to announce the launch of <b>The Rockstars of EPNS V2.</b>\\n\\nAnd of course you‚Äôll get to know how you could partake in collecting these NFTs, pretty soon.\\n\\nStay tuned for more updates on our social media for that one!\\n\\n![NFT Communication Image](./image-5.webp)\\n\\nWhile we‚Äôre there, on the <b>22nd of June 2022</b>, our <b>Co-Founder Richa Joshi</b> will be doing an interesting talk about Building the communication layer for NFTs which would focus on:\\n\\nThe what and why web3 communication is important for NFTs. Use cases of web3 communication across NFTs, DeFi, Gaming, Content and How to Notify using EPNS across the NFTverse.\\n\\n- <b>Title:</b> Why NFT Communication Matters\\n- <b>Speaker üí¨:</b> Richa Joshi ‚Äî Co-Founder EPNS\\n- <b>Time ‚è≤Ô∏è:</b> 10:30 AM\\n- <b>Date üìÖ:</b> Wed 6/22/2022\\n- <b>Locationüìç:</b> Tron DAO Theatre at the Marriott Marquis (7th Floor)\\n\\nSpeaking of NFTVerse, you might want to check out our latest blog we wrote on <b>Why engaging with your users within the NFTVerse matters!</b>\\n\\n<iframe src=\\"https://cdn.embedly.com/widgets/media.html?type=text%2Fhtml&amp;key=a19fcc184b9711e1b4764040d3dc5c07&amp;schema=twitter&amp;url=https%3A//twitter.com/epnsproject/status/1537480225256136704&amp;image=https%3A//i.embed.ly/1/image%3Furl%3Dhttps%253A%252F%252Fabs.twimg.com%252Ferrors%252Flogo46x38.png%26key%3Da19fcc184b9711e1b4764040d3dc5c07\\" allowfullscreen=\\"\\" frameborder=\\"0\\" height=\\"689\\" width=\\"680\\" title=\\"EPNS | $PUSH on Twitter: &quot;As we approach #NFTNYC2022 &amp; the #NFTVerse grows we feel a strong need for a native communication layer to accelerate growth! üå±In our latest blog we share exactly Why Engaging with Users Within the NFTVerse Matters &amp; how #Web3Comm will help! üë©üèæ‚Äçü§ù‚Äçüë©üèªü§ùüì∞üëâ https://t.co/w7URfE6Pkz pic.twitter.com/LCWGkk55jh / Twitter&quot;\\" class=\\"ek n fc dx bg\\" scrolling=\\"no\\"></iframe>\\n\\n#### Lastly, What‚Äôs #MYNFTStory\\n\\n<VideoContainer>\\n<iframe width=\\"100%\\" height=\\"100%\\" style={{ borderRadius: \\"32px\\" }} src=\\"https://www.youtube.com/embed/rPtUvV_1hW0\\" title=\\"At @NFTNYC we ask you &quot;What&#39;s #MyNFTStory&quot;\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" allowfullscreen></iframe>\\n</VideoContainer>\\n\\nSince NFT NYC is also one of the biggest NFT Parties across the world, we were like, almost certain that a bunch of us frens would share a ton of #NFTStories as conversation starters, icebreakers and what not!\\n\\nAnd that‚Äôs when we struck this idea of launching a really cool campaign where you ask yourselves\\n\\n‚ÄòWhats <b>#MYNFTStory?‚Äô</b>\\n\\n- #### You might be an NFTHODLer\\n- #### An NFT Artist!\\n- #### Founder of an NFTProject\\n- #### Or just part of NFT Projects and eager to get in\\n\\nA chance to share your NFTStory and heck, even WIN something BIG!\\n\\n#### Participate in this campaign of ours!\\n\\n<iframe src=\\"https://cdn.embedly.com/widgets/media.html?type=text%2Fhtml&amp;key=a19fcc184b9711e1b4764040d3dc5c07&amp;schema=twitter&amp;url=https%3A//twitter.com/epnsproject/status/1538873089945006080&amp;image=https%3A//i.embed.ly/1/image%3Furl%3Dhttps%253A%252F%252Fabs.twimg.com%252Ferrors%252Flogo46x38.png%26key%3Da19fcc184b9711e1b4764040d3dc5c07\\" allowfullscreen=\\"\\" frameborder=\\"0\\" height=\\"600\\" width=\\"680\\" title=\\"EPNS | $PUSH on Twitter: &quot;Ok, NFT Time! In 250 chars or less, tell us about your favorite NFT story by replying below üëá and we might drop something! LFG!!!! #MyNFTStory #NFTNYC2022 @NFT_NYC pic.twitter.com/EObxYvSzJi / Twitter&quot;\\" class=\\"ek n fc dx bg\\" scrolling=\\"no\\"></iframe>\\n\\n- Go to our [#MyNFTStory Twitter Campaign](https://twitter.com/epnsproject/status/1538873089945006080)\\n- Reply to this tweet with a story of your first or your favorite NFT\\n- Use #MYNFTStory #NFTNYC2022\\n- And you might WIN one of our Rockstars Of EPNS NFT & 2400 $PUSH\\n\\nWith so many awesome happenings at this great event, we‚Äôre really looking forward to being part of them and interacting with all you community members! Given that it‚Äôs been a while since we‚Äôve been to an IRL event post ETHAmsterdam.\\n\\nSpeaking of which, post NFT NYC, we‚Äôll also be doing a Hackathon as part of ETHGLobal‚Äôs ETHNYC! So stay tuned for more details on that one soon."}}');

